    true,nt"url": null,nt"notes": "This dataset includes temperature profiles
    from 30 boreholes throughout Maine that were selected for their depth, location,
    and lithologies encountered.  Depths range from about 300 feet to 2,200 feet.  Most
    of the boreholes selected for measurement were completed in granite because this
    lithology can be assumed to be nearly homogeneous over the depth of the borehole.
     Boreholes were also selected to address gaps in existing geothermal datasets.
     Temperature profiles were collected in October and November, 2012.",nt"license_title":
